import React from 'react'
import Header from '../frontend-js/header'
import Footer from '../frontend-js/footer'
import '../frontend-scss/projects.css'
import { Component } from 'react'

export default class projects extends Component {
    constructor(props){
        super(props);
        this.state={
            projectsList:[
                {
                    name: 'E-commerce',
                    stack: 'ReactJS, Redux, Bootstrap, MySQL',
                    duration: '3 months'
                }
            ]
        }
    }
    render() {
        return (
            <div className='projectsWrapper'>
                <Header/>
                <div className='projectsList'>
                    {this.state.projectsList.map(project=>
                    <div className='projectWrapper'>
                        <p className='projectName'>Name: {project.name}</p>
                        <p className='projectStack'>Stack: {project.stack}</p>
                        <p className='projectDuration'>Duration: {project.duration}</p>
                    </div>)}
                </div>
                <Footer/>

            </div>
        )
    }
}
